const channels = require.context('.', true, /_channel\.js$/)
channels.keys().forEach(channels)

$("#click_add").click(function(event) {
  event.preventDefault();
  $("#form_add").submit();
});

$(document).ready(function() {

  $("#add_form").hide();

  $("#minus").click(function(){
    $("#add_form").hide();
  });

  $("#plus").click(function(){
    $("#add_form").show();
  });

});
